window.requirejs.config({paths:{anychart:"https://cdn.anychart.com/releases/8.3.0/js/anychart-bundle.min"}});window.VisualizationTools.anychart=function(element,json,callback){require(["anychart"],function(dummy){window.anychart.fromJson(json.data).container(element).draw();window.resizeToShowContents(element);$(element).find("svg").each(function(idx,elt){$(elt).height($(elt.parentNode).height())});callback(element,element.childNodes[0])})};